import React, { Component } from 'react';
import './head.css'
let data_1 = [
    {
        li_name: "ресив",
        ul_notis: [
            "111111",
            "22222222",
            {
                "sor": [
                    11,
                    22,
                    33,
                    44
                ]
            },
            "4444",
        ]
    },
    {
        li_name: "каналы",
        ul_notis: "31111",
        id: "22",
    },
    {
        li_name: "баги",
        ul_notis: "",
        id: "22",
    },
    {
        li_name: "заказы",
        ul_notis: "311ddd11",
        id: "22",
    },
    {
        li_name: "IT",
        ul_notis: "wwww",
        id: "22",
    },
]


const tt = data_1.map(el => <div>{el.li_name + "   " + el.ul_notis + " " + el.sor.map(em => Console.log(em))}</div>)

const Head_ul = () => {
    return (
        <div>
            {tt}
        </div>
    )
}
export default Head_ul;










